import logo from "./logo.svg";
import "./App.css";

function App() {
  return (
    <>
      <header>
        <h2 className="logo">Logo</h2>
        <nav className="navigation">
          <a href="#">Home</a>
          <a href="#">About</a>
          <a href="#">Service</a>
          <a href="#">Contact</a>
        </nav>
      </header>
    </>
  );
}

export default App;
